import { Flex, FlexItem } from "../../core/Flex";
import Input from "../../core/Input";

export function Login() {
  return (
    <MaxWidth className={css({ width: '100%' })}>
      <Card>
        <CardBody>
          <Flex>
            <h1
              className={css({
                fontSize: 24,
                lineHeight: "32px",
                margin: "0 0 16px"
              })}
            >
              Login to clique
            </h1>
          </Flex>
          <Flex>
            <FlexItem>
              <Input type="text" />

              <Input type="text" />
            </FlexItem>
          </Flex>
        </CardBody>
      </Card>
    </MaxWidth>
  );
}
